import React from "react";
import "./navbar.css";

const Navbar = () => {
  return (
    <section className="navBarSection">
      <header className="header flex">
        <div className="logoDDiv"></div>
        <a href="#" className="logo"></a>
        <h1>Travel.</h1>
      </header>
    </section>
  );
};

export default Navbar;
